import React from 'react';

class App extends React.Component {
  render() {
    return (
      <form>
          <h1 style={{color:'blue', marginLeft:200}}>Try my Demo</h1>
          <div style={{marginLeft:250}}>
            <p>Enter your name:</p>
            <textarea rows="4" cols="100" name="comment" form="usrform">
            Enter text here...</textarea>

            <p>The text area above is outside the form element, but should still be a part of the form.</p>

            <p><b>Note:</b> The form attribute is not supported in IE.</p>
          </div>
      </form>
    );
  }
}

export default App;
